import React, { useState } from "react";

const Home = (props) => {
	const [padawans, setPadawans] = useState([
		"Alexandre",
		"Thibault",
		"Clémence",
		"Elena",
		"Jega",
		"Julien",
		"Lilian",
		"Rim",
		"Shelley",
	]);

	return (
		<ul>
			{padawans.map((padawan) => (
				<li key={padawan}>{padawan}</li>
			))}
			{/* {
                padawans.map(padawan => {
                    return (<li key={padawan}>{padawan}</li>)
                })
            } */}
		</ul>
	);
};

export default Home;

